import React, { Component } from 'react';
import QrReader from 'react-qr-reader';
class Login extends Component {
	constructor(props) {
		super(props);
		this.state = {
				result: '',
				changDelay : 300,
				cam : 'environment',
				cam2 : 600
		};
}
	render() { 
		return (
			<div className="App">
			<header className="App-header">
				<p>Đăng nhập + đăng ký nhanh</p>



				<button className="btn btn-success fa fa-github" onClick={() => this.props.authenticate("Github")}>
				</button>

				<div>
					<p>Hoặc</p>
				</div>

				<button className="btn btn-primary fa fa-facebook" onClick={() => this.props.authenticate("Facebook")}>
				</button>
			</header>
			</div>
		);
	}
}

export default Login;
